  {
    name: "id",
    selector: (row: any) => row.id,
    
  },
  {
    name: "Nombre",
    selector: (row: any) => row.nombre,
    sortable: true,
  },
  {
    name: "Apellido",
    selector: (row: any) => row.apellido,
    sortable: true,
  },
  {
    name: "Email-@",
    
    
  },
  {
    name: "Telefono",
    selector: (row: any) => row.telefono,
  

  },
  {
    name: "Estatus",
    selector: (row: any) => row.Estatus,
  
  },
  {
    name: "Acciones",
    selector: (row: any) => row.acciones,
  
  },
];



const data = [
  { id: 1, nombre: "John Doe", email: "john.doe@example.com", age: 28, acciones: <button style={{ borderStyle: "none" }} type="button" className="btn btn-primary"> üîÑ</button>},
  { id: 2, nombre: "Jane Smith", email: "jane.smith@example.com", age: 34, acciones: <button style={{ borderStyle: 'none' }} type='button' className='btn btn-warning'>‚úèÔ∏è</button> },
];

const Dash1: FC = () => {
  return (
    <div className="table-wrapper">
      <DataTable
        columns={columns}
        data={data}
        pagination
        paginationPerPage={10}
        selectableRows
        fixedHeader 
      />
    </div>
  );
};

export default Dash1;

